pragma solidity ^0.5.10;

import "../libraries/SafeMath.sol";
import "../permissions/SelfAuthorized.sol";

contract SignerManager is SelfAuthorized {

    using SafeMath for uint256;

    /////
    // Constants:
    /////

    address public constant LL_HEAD = address(0x1);  // Head of the signers linked list.

    /////
    // Storage:
    /////

    uint256 public threshold;
    uint256 public signerCount;
    mapping (address => address) public signers;  // Circular linked list of signers.

    /////
    // Events:
    /////

    event AddSigner(address indexed signer);
    event RemoveSigner(address indexed signer);
    event SetThreshold(uint indexed threshold);
    event BurnAccess();

    /////
    // Modifiers:
    /////

    modifier onlySigner() {
        require(isValidSigner(msg.sender), "not-a-signer");
        _;
    }

    /////
    // Public functions
    /////

    function setThreshold(uint _threshold)
        public
        onlySelf
    {
        _setThreshold(_threshold);
    }

    function addSigner(address _signer)
        public
        onlySelf
    {
        _addSigner(_signer);
    }

    function removeSigner(
        address _prevSigner,
        address _signer
    )
        public
        onlySelf
    {
        _removeSigner(_prevSigner, _signer);
    }

    function addSignerSetThreshold(
        address _signer,
        uint _threshold
    )
        public
        onlySelf
    {
        _addSigner(_signer);
        _setThreshold(_threshold);
    }

    function removeSignerSetThreshold(
        address _prevSigner,
        address _signer,
        uint _threshold
    )
        public
        onlySelf
    {
        _setThreshold(_threshold);
        _removeSigner(_prevSigner, _signer);
    }

    function burnAccess()
        public
        onlySelf
    {
        threshold = uint(-1);
        signerCount = uint(0);
        signers[LL_HEAD] = address(0);
        emit BurnAccess();
    }

    /////
    // Public view functions:
    /////

    function isValidSigner(address _signer)
        public
        view
        returns (bool)
    {
        return signers[_signer] != address(0);
    }

    function getSigners()
        public
        view
        returns (address[] memory)
    {
        address[] memory signersArray = new address[](signerCount);
        uint256 idx = 0;
        address signer = signers[LL_HEAD];
        while (signer != LL_HEAD) {
            signersArray[idx] = signer;
            signer = signers[signer];
            idx++;
        }
        return signersArray;
    }

    /////
    // Internal functions
    /////

    function _setupSigners(
        address[] memory _signers,
        uint _threshold
    )
        internal
    {
        require(threshold == 0, "threshold-set");
        require(_threshold > 0, "no-threshold");
        require(_threshold <= _signers.length, "not-enough-signers");
        address lastSigner = LL_HEAD;
        for (uint256 i = 0; i < _signers.length; i++) {
            address _signer = _signers[i];
            require(_signer != address(0) && _signer != LL_HEAD, "invalid-signer");
            require(signers[_signer] == address(0), "duplicate-signer");
            signers[lastSigner] = _signer;
            lastSigner = _signer;
        }
        signers[lastSigner] = LL_HEAD;
        signerCount = _signers.length;
        threshold = _threshold;
    }

    function _addSigner(address _signer)
        internal
    {
        require(_signer != address(0) && _signer != LL_HEAD, "invalid-signer");
        require(signers[_signer] == address(0), "duplicate-signer");
        // insert new signer at the front of the linked list
        signers[_signer] = signers[LL_HEAD];
        signers[LL_HEAD] = _signer;
        signerCount = signerCount.add(1);
        emit AddSigner(_signer);
    }

    // note that you need to provide the previous address in the linked list
    // in order to remove a signer
    function _removeSigner(
        address _prevSigner,
        address _signer
    )
        internal
    {
        uint newSignerCount = signerCount.sub(1);
        require(newSignerCount >= threshold, "not-enough-signers");
        require(signers[_prevSigner] == _signer, "invalid-prevSigner");
        require(_signer != address(0) && _signer != LL_HEAD, "invalid-signer");
        signers[_prevSigner] = signers[_signer];
        signers[_signer] = address(0);
        signerCount = newSignerCount;
        emit RemoveSigner(_signer);
    }

    function _setThreshold(uint _threshold)
        internal
    {
        require(_threshold <= signerCount, "invalid-threshold");
        require(_threshold > 0, "invalid-threshold");
        threshold = _threshold;
        emit SetThreshold(_threshold);
    }
}
